eadField -->\n<div class="form-field">\n    <div class="form-field-label">${label}：</div>\n    <div class="form-field-value">\n        ${value}\n        <esui-label data-ui-id="modify-${field}" class="form-field-edit-entry">修改</esui-label>\n    </div>\n</div>\n\n<!-- target: ellipsisLabelReadField -->\n<!-- var: id = ${id} || ${values} -->\n<!-- var: tail = ${tail} || ${label} -->\n<!-- var: maxLength = ${maxLength} || \'2\' -->\n<div class="form-field">\n    <div class="form-field-label">${label}：</div>\n    <div class="form-field-value">\n        <div data-ui-type="Ellipsis" data-ui-id="${id | dasherize}" data-ui-max-length="${maxLength}" data-ui-tail="${tail}"\n            data-ui-datasource="@${values}">\n        </div>\n    </div>\n</div>\n\n<!-- master: readView -->\n<div class="form-view">\n    <esui-panel class="content-main" data-ui-id="form-content-main"\n        data-ui-extension-command-type="Command" data-command="form-content-click">\n        <!-- contentplaceholder: sections --><!-- /contentplaceholder -->\n    </esui-panel>\n    <!-- import: readReturnSection -->\n</div>\n\n<!-- master: readViewWithOwnActionArea -->\n<div class="form-view">\n    <esui-panel class="content-main" data-ui-id="form-content-main"\n        data-ui-extension-command-type="Command" data-command="form-content-click">\n        <!-- contentplaceholder: sections --><!-- /contentplaceholder -->\n    </esui-panel>\n    <!-- contentplaceholder: readCommandSection --><!-- /contentplaceholder -->\n</div>\n\n<!-- target: readReturnSection -->\n<esui-panel class="form-submit-section" data-ui-id="submit-section">\n    <span data-ui-type="Button" data-ui-id="return" data-ui-skin="link">返回</span>\n</esui-panel>\n\n<!-- target: staticTable -->\r\n<div data-ui-type="Table" data-ui-datasource="@pageData"\r\n    data-ui-id="table" data-ui-select="single">\r\n</div>\r\n<!-- target: staticPager -->\r\n<div data-ui-type="Pager" data-ui-id="pager"\r\n    data-ui-count="@totalCount" data-ui-page="